import React, { useState } from "react";
import "./App.css";

function DropdownList({ numDropdowns }) {
  const [selectedValues, setSelectedValues] = useState(Array(numDropdowns).fill({ subject: "", section: "" }));

  const handleSubjectChange = (event, index) => {
    const newSelectedValues = [...selectedValues];
    newSelectedValues[index].subject = event.target.value;
    setSelectedValues(newSelectedValues);
  };

  const handleSectionChange = (event, index) => {
    const newSelectedValues = [...selectedValues];
    newSelectedValues[index].section = event.target.value;
    setSelectedValues(newSelectedValues);
  };

  const dropdowns = [...Array(numDropdowns)].map((_, i) => (
    <div key={i}>
      <label htmlFor={`subject-${i}`}>Select Subject:</label>
      <select id={`subject-${i}`} value={selectedValues[i].subject} onChange={(event) => handleSubjectChange(event, i)}>
        <option value="" disabled>
          None
        </option>
        <option value="Math">Math</option>
        <option value="Science">Science</option>
        <option value="English">English</option>
      </select>
      <label htmlFor={`section-${i}`}>Select Section:</label>
      <select id={`section-${i}`} value={selectedValues[i].section} onChange={(event) => handleSectionChange(event, i)}>
        <option value="" disabled>
          None
        </option>
        <option value="A">A</option>
        <option value="B">B</option>
        <option value="C">C</option>
      </select>
    </div>
  ));

  return <div>{dropdowns}</div>;
}

function App() {
  const [selectedValue, setSelectedValue] = useState("");
  const [nextClicked, setNextClicked] = useState(false);
  const [numDropdowns, setNumDropdowns] = useState(1);

  const handleChange = (event) => {
    setSelectedValue(event.target.value);
  };

  const handleNext1 = (event) => {
    if (selectedValue === "") {
      event.preventDefault();
    } else {
      console.log("Selected value:", selectedValue);
      setNextClicked(true);
    }
  };

  const handleBack = () => {
    setNextClicked(false);
  };

  const handleNumDropdownsChange = (event) => {
    setNumDropdowns(parseInt(event.target.value));
  };

  return (
    <div className="center-container">
      {!nextClicked && (
        <>
          <h1 className="center">Select Number of Subjects</h1>
          <select
            value-number={selectedValue}
            onChange={handleChange}
            className="center-dropdown"
          >
            <option value="" disabled>
              None
            </option>
            {[...Array(9)].map((_, i) => (
              <option key={i} value={i + 1}>
                {i + 1}
              </option>
            ))}
          </select>
          <button className="next-button" onClick={handleNext1}>
            Next
          </button>
        </>
      )}
      {nextClicked && (
        <>
          <div>
            <select
              id="num-dropdowns"
              sub-num={value-number}
              onChange={handleNumDropdownsChange}
            >
              {[...Array(9)].map((_, i) => (
                <option key={i} value={i + 1}>
                  {i + 1}
                </option>
              ))}
            </select>
            <DropdownList numDropdowns={numDropdowns} />
          </div>
          <button className="next-button-right" onClick={handleNext1}>
            Next
          </button>
          <button className="back-button-left" onClick={handleBack}>
            Back
          </button>
        </>
      )}
    </div>
  );
}

export default App;
